INSERT INTO `tbl_test_questions` VALUES (1,'T004','Which JavaScript runtime is built on Chrome\'s V8 engine?',NULL,NULL,NULL,NULL,'C',0),(2,'T004','Which JavaScript runtime is built on Chrome\'s V8 engine?','ReactJS','Angular','Node.js','Vue.js','C',0),(3,'T069','What keyword is used to declare a constant variable in Java?','static','final','const','immutable','B',0),(4,'T069','Which of the following data types is used to store a single character in Java?','String','int','char','boolean','C',0),(5,'T069','What is the correct way to create an object of the class \'Dog\' in Java?','Dog myDog = new Dog;','Dog myDog = new Dog();','new Dog = myDog;','Dog = new myDog();','B',0),(6,'T069','Which of the following is NOT a valid access modifier in Java?','public','private','protected','friend','D',0),(7,'T069','Which operator is used for assignment in Java?','==','=','===',':=','B',0),(8,'T070','Which of the following is the correct way to create a thread in Java?','Extends the `Thread` class.','Implements the `Runnable` interface.','Extends the `Thread` class or implements the `Runnable` interface.','Uses the `Threads` class.','C',0),(9,'T070','What is the purpose of the `synchronized` keyword in Java?','To declare a variable as constant.','To prevent multiple threads from accessing a block of code concurrently.','To create a new thread.','To handle exceptions.','B',0),(10,'T070','Which of the following statements about Java Generics is true?','Generics only work with primitive data types.','Generics are used to increase the performance of Java programs by reducing memory usage.','Generics allow you to write type-safe code that can work with different types of objects.','Generics are a replacement for inheritance.','C',0),(11,'T070','What is the purpose of the `try-with-resources` statement in Java?','To handle exceptions that occur during resource allocation.','To automatically close resources after they are used.','To improve the performance of I/O operations.','To create a new thread for resource management.','B',0),(12,'T070','Which of the following interfaces is used to define a functional interface in Java?','`Runnable`','`Callable`','`Function`','`@FunctionalInterface`','D',0),(13,'T070','What is the primary purpose of the Java Collections Framework?','To provide a set of interfaces and classes for storing and manipulating groups of objects.','To handle input/output operations.','To manage threads.','To perform mathematical calculations.','A',0),(14,'T070','Which of the following is NOT a core interface of the Java Collections Framework?','`List`','`Set`','`Map`','`Pointer`','D',0),(15,'T070','Which of the following data structures guarantees the elements will be stored in sorted order?','`HashSet`','`ArrayList`','`TreeMap`','`HashMap`','C',0),(16,'T070','What is the purpose of serialization in Java?','To convert Java source code into bytecode.','To convert an object into a stream of bytes for storage or transmission.','To compile Java code.','To encrypt Java code.','B',0),(17,'T070','Which of the following is a benefit of using the `ExecutorService` in Java concurrency?','It automatically handles deadlocks.','It simplifies thread management and pooling.','It guarantees that all tasks will complete successfully.','It eliminates the need for synchronization.','B',0),(18,'T070','What is reflection in Java?','The ability to examine and modify the behavior of classes, interfaces, fields, and methods at runtime.','The process of creating copies of objects.','The mechanism for handling exceptions.','The process of compiling Java code.','A',0),(19,'T070','Which design pattern defines a one-to-many dependency between objects so that when one object changes state, all its dependents are notified and updated automatically?','Singleton','Factory','Observer','Decorator','C',0),(20,'T070','What is the purpose of the `volatile` keyword in Java?','To declare a constant variable.','To ensure that a variable\'s value is always read from and wri